import React from 'react';
import { useHistory } from 'react-router-dom';
import './info.css';
import { Button } from '@mui/material/';

function Info() {
  const CallInfoPage = async () => {
    try{
      const res = await axios.post('http://localhost:5000/info');
    } catch (error){
      console.log(error);
    }
  }
  useEffect(()=> {
    CallInfoPage();
  }, []);
  let history = useHistory();
  const addWorkout = () => {
    history.push('/data');
  };

  return (
    <>
      <div className='infomain'>
        <div className='fitness'>
          <h1>My Fitness Tracker</h1>
          <Button variant='contained' onClick={addWorkout}>
            Add Workout
          </Button>
        </div>
      </div>
    </>
  );
}
export default Info;
